import React from 'react';

// this is the equivalent to the createStore method of Redux
// https://redux.js.org/api/createstore

const MyContext = React.createContext({
	market_structure: [1,2,3,4],
	market_data: ['a', 'b', 'c', 'd']
});

export default MyContext;
